#!/usr/bin/env python3
"""
BUZZ (Termux Trivia) - Text-only, English-only, no-root
- Ships with a FIXED, prebuilt question DB: 15,000 questions (no runtime generation).
- Auto-creates ~/Buzz/ and stores:
    ~/Buzz/data/questions_en.jsonl.gz
    ~/Buzz/data/highscores.json
    ~/Buzz/data/profiles.json
    ~/Buzz/data/settings.json
- Up to 2 players (pass-and-play)
- Categories: a broad superset inspired by PS3 Buzz titles (Quiz TV / Quiz World / Brain of... / Ultimate Music Quiz)
- NEW:
    * Difficulty selection (All / Easy / Medium / Hard) for every mode
    * More Buzz-style round types (text-only)

All questions are original and template-authored (no real Buzz! content).
"""

