# -------------------- Terminal helpers --------------------
def clear() -> None:
    os.system("clear" if os.name != "nt" else "cls")

def pause(msg: str="Press ENTER to continue...") -> None:
    try:
        input(msg)
    except KeyboardInterrupt:
        print()

def norm(s: str) -> str:
    return " ".join(s.strip().lower().split())

def now_iso() -> str:
    return datetime.utcnow().strftime("%Y-%m-%dT%H:%M:%SZ")

# Timed input (best-effort; falls back if unsupported)
def timed_input(prompt: str, timeout: int) -> Tuple[str, float, bool]:
    start = time.perf_counter()
    if timeout <= 0:
        try:
            s = input(prompt)
        except EOFError:
            s = ""
        return s, time.perf_counter() - start, False
    try:
        import signal
        class _T(Exception): pass
        def handler(signum, frame): raise _T()
        old = signal.signal(signal.SIGALRM, handler)
        signal.alarm(timeout)
        try:
            s = input(prompt)
            return s, time.perf_counter() - start, False
        except _T:
            return "", time.perf_counter() - start, True
        finally:
            signal.alarm(0)
            signal.signal(signal.SIGALRM, old)
    except Exception:
        try:
            s = input(prompt)
        except EOFError:
            s = ""
        return s, time.perf_counter() - start, False

# -------------------- Storage --------------------
def ensure_dirs() -> None:
    os.makedirs(DATA_DIR, exist_ok=True)

def load_json(path: str, default):
    try:
        with open(path, "r", encoding="utf-8") as f:
            return json.load(f)
    except Exception:
        return default

def save_json(path: str, data) -> None:
    tmp = path + ".tmp"
    with open(tmp, "w", encoding="utf-8") as f:
        json.dump(data, f, ensure_ascii=False, indent=2)
    os.replace(tmp, path)

def install_db_if_missing() -> None:
    ensure_dirs()
    if os.path.exists(DB_PATH):
        return
    raw = base64.b64decode(_EMBEDDED_DB_B64.encode("ascii"))
    with open(DB_PATH, "wb") as f:
        f.write(raw)

def load_db() -> List[dict]:
    with gzip.open(DB_PATH, "rt", encoding="utf-8") as f:
        return [json.loads(line) for line in f if line.strip()]

# -------------------- Profiles / Nicknames --------------------
def init_profiles() -> dict:
    profiles = load_json(PROFILES_PATH, None)
    if not isinstance(profiles, dict):
        profiles = {"players": {}}
        save_json(PROFILES_PATH, profiles)
    if "players" not in profiles or not isinstance(profiles["players"], dict):
        profiles["players"] = {}
    return profiles

def get_or_create_player(profiles: dict, display_name: str) -> dict:
    key = display_name.strip() or "Player"
    if key not in profiles["players"]:
        profiles["players"][key] = {
            "display_name": key,
            "nickname": key,
            "created": now_iso(),
            "games_played": 0,
            "best_scores": {},   # mode -> best
            "total_points": 0,
        }
        save_json(PROFILES_PATH, profiles)
    return profiles["players"][key]

def choose_player(profiles: dict, label: str) -> dict:
    clear()
    print(f"=== {label} ===\n")
    players = list(profiles["players"].keys())
    if players:
        print("Existing profiles:")
        for i, name in enumerate(players, start=1):
            nick = profiles["players"][name].get("nickname", name)
            print(f"  {i}) {name} (nick: {nick})")
        print("\n0) Create new")
        c = input("\nChoose: ").strip()
        if c.isdigit() and c != "0":
            idx = int(c) - 1
            if 0 <= idx < len(players):
                return profiles["players"][players[idx]]
    name = input("Enter profile name: ").strip() or "Player"
    p = get_or_create_player(profiles, name)
    nick = input("Nickname (ENTER to keep same): ").strip()
    if nick:
        p["nickname"] = nick
        save_json(PROFILES_PATH, profiles)
    return p

def edit_profile(profiles: dict) -> None:
    clear()
    print("=== EDIT PROFILES ===\n")
    names = list(profiles["players"].keys())
    if not names:
        print("No profiles yet.")
        pause()
        return
    for i, n in enumerate(names, start=1):
        p = profiles["players"][n]
        print(f"{i}) {n}  (nick: {p.get('nickname', n)})")
    print("0) Back")
    c = input("\nChoose: ").strip()
    if c == "0":
        return
    if c.isdigit():
        idx = int(c)-1
        if 0 <= idx < len(names):
            key = names[idx]
            p = profiles["players"][key]
            clear()
            print(f"Editing: {key}\n")
            new_nick = input(f"New nickname (current: {p.get('nickname', key)}): ").strip()
            if new_nick:
                p["nickname"] = new_nick
            save_json(PROFILES_PATH, profiles)
            print("Saved.")
            pause()

# -------------------- Highscores / Leaderboards --------------------
def init_highscores() -> dict:
    hs = load_json(HIGHSCORES_PATH, None)
    if not isinstance(hs, dict):
        hs = {"records": [], "leaderboards": {}}
        save_json(HIGHSCORES_PATH, hs)
    if "records" not in hs: hs["records"] = []
    if "leaderboards" not in hs or not isinstance(hs["leaderboards"], dict):
        hs["leaderboards"] = {}
    return hs

def update_leaderboard(hs: dict, mode: str, player_nick: str, score: int) -> None:
    lb = hs["leaderboards"].setdefault(mode, [])
    lb.append({"nick": player_nick, "score": int(score), "time": now_iso()})
    lb.sort(key=lambda x: x["score"], reverse=True)
    hs["leaderboards"][mode] = lb[:25]

def add_record(hs: dict, mode: str, players: List[str], scores: Dict[str,int], meta: dict) -> None:
    hs["records"].append({
        "time": now_iso(),
        "mode": mode,
        "players": players,
        "scores": scores,
        "meta": meta,
    })
    hs["records"] = hs["records"][-300:]

def show_highscores() -> None:
    hs = init_highscores()
    clear()
    print("=== HIGHSCORES ===\n")
    print("1) Recent games")
    print("2) Leaderboards")
    print("0) Back")
    c = input("\nChoose: ").strip()
    if c == "0":
        return

    if c == "1":
        clear()
        print("=== RECENT GAMES (latest first) ===\n")
        recs = hs.get("records", [])
        if not recs:
            print("No games recorded yet.")
            pause()
            return
        for rec in reversed(recs[-25:]):
            t = rec.get("time","")
            mode = rec.get("mode","?")
            players = rec.get("players",[])
            scores = rec.get("scores",{})
            meta = rec.get("meta",{})
            print(f"{t} | {mode} | " + "  ".join([f"{p}:{scores.get(p,0)}" for p in players]))
            if meta:
                print("  info:", meta)
        pause()
        return

    if c == "2":
        clear()
        lbs = hs.get("leaderboards", {})
        if not lbs:
            print("No leaderboards yet.")
            pause()
            return
        modes = sorted(lbs.keys())
        for i, m in enumerate(modes, start=1):
            print(f"{i}) {m}")
        print("0) Back")
        k = input("\nChoose mode: ").strip()
        if k == "0":
            return
        if k.isdigit():
            idx = int(k)-1
            if 0 <= idx < len(modes):
                mode = modes[idx]
                clear()
                print(f"=== LEADERBOARD: {mode} ===\n")
                for i, e in enumerate(lbs.get(mode, []), start=1):
                    print(f"{i:02d}. {e['nick']} - {e['score']}  ({e['time']})")
                pause()
        return

