    total = int(cfg.get("duel_questions", 12))
    tlim = int(cfg.get("timer_seconds", 10))

    clear()
    print(f"=== DUEL ===\nCategory: {cat} | Questions: {total} | Timer: {tlim}s | Diff: {difficulty}\n")
    pause("Press ENTER to begin...")
    for i in range(total):
        q = rng.choice(pool)
        clear()
        print(f"Duel {i+1}/{total} | Score: {n1}:{scores[n1]}  {n2}:{scores[n2]}\n")
        print(f"{n1} answers first:")
        ok1, t1, to1, ans = ask_question(q, tlim)
        print(f"\n{n2} answers:")
        ok2, t2, to2, _ = ask_question(q, tlim)

        if ok1 and ok2:
            if t1 < t2:
                scores[n1] += 200
                scores[n2] += 100
            elif t2 < t1:
                scores[n2] += 200
                scores[n1] += 100
            else:
                scores[n1] += 150
                scores[n2] += 150
            print("\n Both correct!")
        elif ok1 and not ok2:
            scores[n1] += 175
            print("\n", n1, "wins that one!")
        elif ok2 and not ok1:
            scores[n2] += 175
            print("\n", n2, "wins that one!")
        else:
            print("\n Nobody got it.")
            print("Answer:", ans)
        pause()

    finalize_game("Duel", difficulty, profiles, hs, players, scores, {"category": cat, "questions": total, "timer": tlim}, save=True)

