    nicks = [p.get("nickname", p.get("display_name","Player")) for p in players]
    scores = {n: 0 for n in nicks}
    lives = {n: int(cfg.get("survival_lives", 3)) for n in nicks}

    cat = choose_category_menu()
    pool = build_pool(db, cat, difficulty) or db
    rng = random.Random()

    clear()
    print(f"=== SURVIVAL ===\nCategory: {cat} | Lives: {cfg.get('survival_lives',3)} | Diff: {difficulty}\n")
    pause("Press ENTER to begin...")

    turn = 0
    while True:
        alive = [n for n in nicks if lives[n] > 0]
        if len(alive) <= 1:
            break
        p = alive[turn % len(alive)]
        clear()
        print("=== SURVIVAL ===")
        print("Lives:", "  ".join([f"{n}:{lives[n]}" for n in nicks]))
        print("Score:", "  ".join([f"{n}:{scores[n]}" for n in nicks]))
        ok, took, to, ans = ask_question(rng.choice(pool), 0)
        if ok:
            scores[p] += 120
            print("\n +120")
        else:
            lives[p] -= 1
            print("\n -1 life")
            print("Answer:", ans)
        pause()
        turn += 1

    finalize_game("Survival", difficulty, profiles, hs, players, scores, {"category": cat}, save=True)

