# -------------------- Settings menu --------------------
def load_settings() -> dict:
    cfg = load_json(SETTINGS_PATH, None)
    if not isinstance(cfg, dict):
        cfg = dict(DEFAULT_SETTINGS)
        save_json(SETTINGS_PATH, cfg)
    for k,v in DEFAULT_SETTINGS.items():
        if k not in cfg:
            cfg[k] = v
    return cfg

def settings_menu(cfg: dict) -> None:
    while True:
        clear()
        print("=== SETTINGS ===\n")
        print(f"1) Timer seconds: {cfg['timer_seconds']}")
        print(f"2) Quickfire questions: {cfg['quickfire_questions']}")
        print(f"3) Marathon questions: {cfg['marathon_questions']}")
        print(f"4) Show rounds: {cfg['show_rounds']}")
        print(f"5) Show questions per round: {cfg['show_questions_per_round']}")
        print(f"6) Duel questions: {cfg['duel_questions']}")
        print(f"7) Survival lives: {cfg['survival_lives']}")
        print(f"8) Boiling Point target: {cfg.get('boiling_target', 5)}")
        print("0) Back")
        c = input("\nChoose: ").strip()
        if c == "0":
            save_json(SETTINGS_PATH, cfg)
            return
        def set_int(key, lo, hi):
            v = input(f"Set {key} ({lo}-{hi}): ").strip()
            if v.isdigit():
                cfg[key] = max(lo, min(hi, int(v)))
        if c == "1": set_int("timer_seconds", 3, 30)
        elif c == "2": set_int("quickfire_questions", 10, 100)
        elif c == "3": set_int("marathon_questions", 20, 200)
        elif c == "4": set_int("show_rounds", 3, 15)
        elif c == "5": set_int("show_questions_per_round", 3, 12)
        elif c == "6": set_int("duel_questions", 6, 50)
        elif c == "7": set_int("survival_lives", 1, 9)
        elif c == "8": set_int("boiling_target", 3, 15)

